import styled from 'styled-components';

export const Title = styled.h1`
    font-size: 64px;
    text-align: center;
    color: #5E5E5E;
    margin: 0;

`

export const FieldInput = styled.div`
   display: flex;
   align-items: center;

   > input{
       border: 0;
       background: 0;
       outline: 0;
       color: #B47AEA;
       ::placeholder{
        color: #B47AEA;
        font-size: 18px;
        font-weight: bold;

       }
    
   } 
   > svg{
        color: #B47AEA;
        font-size: 24px;

   }


`

export const Page = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: flex-start;
    align-items: center;



`
